PRINT '-- BEGIN TRANSACTION --';
BEGIN TRANSACTION;
PRINT '-- CREATE CUSTOMERS TABLE --';
CREATE TABLE [Customers] (
	[Id]	      [UNIQUEIDENTIFIER] CONSTRAINT [PK_Customers] PRIMARY KEY,
	[Address]	[VARCHAR](MAX),
	[Company]	[VARCHAR](MAX),
	[Email]	[VARCHAR](MAX),
	[FirstName]	[VARCHAR](MAX),
	[LastName]	[VARCHAR](MAX),
	[Phone]	[VARCHAR](MAX)
) ON [PRIMARY];

PRINT '-- CREATE PRODUCTS TABLE --';
CREATE TABLE [Products] (
	[Id]	               [UNIQUEIDENTIFIER] CONSTRAINT [PK_Products] PRIMARY KEY,
	[Color]	         [VARCHAR](MAX),
	[DaysToManufacture]  [INT] NOT NULL,
	[Description]	   [VARCHAR](MAX),
	[ListPrice]	         [DECIMAL](10,2) NOT NULL,
	[Name]	         [VARCHAR](MAX),
	[StandardCost]	   [DECIMAL](10,2) NOT NULL,
	[Weight]	         [DECIMAL](10,2) NOT NULL
) ON [PRIMARY];

PRINT '-- CREATE ORDERS TABLE --';
CREATE TABLE [Orders] (
	[Id]			   [UNIQUEIDENTIFIER] CONSTRAINT [PK_Orders] PRIMARY KEY,
	[Address]		   [VARCHAR](MAX),
	[CustomerId]	   [UNIQUEIDENTIFIER] CONSTRAINT [FK_Orders_Customers_CustomerId] NOT NULL REFERENCES [Customers] ([Id]) ON DELETE CASCADE,
	[CustomerName]	   [VARCHAR](MAX),
	[DateFilled]	   [DATETIME],
	[DatePlaced]	   [DATETIME] NOT NULL,
	[InvoiceNumber]	   [INT] NOT NULL,
	[PaymentStatus]	   [INT] NOT NULL,
	[Status]	         [INT] NOT NULL,
	[Term]	         [INT] NOT NULL,	
) ON [PRIMARY];

PRINT '-- CREATE LINEITEMS TABLE --';
CREATE TABLE [LineItems] (
	"Id"	      [UNIQUEIDENTIFIER] CONSTRAINT "PK_LineItems" PRIMARY KEY,
	"OrderId"	[UNIQUEIDENTIFIER] CONSTRAINT [FK_LineItems_Orders_OrderId] NOT NULL REFERENCES [Orders] ([Id]) ON DELETE CASCADE,
	"ProductId"	[UNIQUEIDENTIFIER] CONSTRAINT [FK_LineItems_Products_ProductId] NOT NULL REFERENCES [Products] ([Id]) ON DELETE CASCADE,
	"Quantity"	[INT] NOT NULL
) ON [PRIMARY];
GO

